import React, { Component } from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import Header  from './components/Header/Header';
import Sidebar  from './components/Sidebar/Sidebar';
import Home  from './components/Home/Home';
import copy from './copy';

class App extends Component {
  constructor(props) {
    super(props)
    this.state = {
      posts: [
        {id: 1, value: "Post1", description: "Lorem Ipsum is simply dummy text of the printing and typesetting industry.Lorem Ipsum is simply dummy text of the printing and typesetting industry."},
        {id: 2, value: "Post2", description: "Lorem Ipsum is simply dummy text of the printing and typesetting industry.Lorem Ipsum is simply dummy text of the printing and typesetting industry."},
        {id: 3, value: "Post3", description: "Lorem Ipsum is simply dummy text of the printing and typesetting industry.Lorem Ipsum is simply dummy text of the printing and typesetting industry."},
        {id: 4, value: "Post4", description: "Lorem Ipsum is simply dummy text of the printing and typesetting industry.Lorem Ipsum is simply dummy text of the printing and typesetting industry."}
      ]
    }
  }

  render() {
    return (
      <Router>
        <div className="App">
          <Header copy={copy}></Header>
          <div className="row">
            <div className="col-md-9 box">
              <div className="inner">
                <Route exact path="/"  render={() => <Home copy={copy} />} />
                <Route path="/about" component={About} />
              </div>
            </div>
            <div className="col-md-3 box">
              <div className="inner">
                <Sidebar copy={copy}></Sidebar>
              </div>
            </div>
          </div>
        </div>
      </Router>
    );
  }
}

function About() {
  return (
    <div>
      <h2>About</h2>
    </div>
  );
}

export default App
